Продам: 

1) "Грандиозное представление" — 1800 рублей. Состояние: снята плёнка, выдавлены жетоны, 0 партий. 

2) Комплект 130 капсул для жетонов 30 мм от Meeple House — 500 рублей. 

3) Дополнение "Осквернённый Грааль. Чудовища Авалона" — 4500 рублей. 

4) Комплект "Осквернённого Грааля", локализация Crowd Games — 8500 рублей. 
В комплект входят: 
— База "Осквернённый Грааль" (первый тираж); 
— Дополнение "Эхо прошлого"; 
— Промо-герой "Ниав";
— Промо "Вечная осень"; 
— Промо "Боевые руны".

Состояние комплекта: 
1) Пройдена базовая кампания 1 раз за двух героев. Использован 1 лист сохранения. Карты игрались в протекторах, протекторы остались только на картах локаций, остальные протекторы снял после прохождения кампании; 
2) Внутри коробка базы пострадала от родной пластиковой крышки ложемента, примеры на фото. Снаружи коробка без повреждений; 
3) Обучающая колода восстановлена, поместил её в отдельный зиппакет. При желании можно пройти обучение; 
4) Двухслойные планшеты героев немного изогнуты из-за недостаточной влажности, отображено на фото. Думаю, можно будет выровнять под прессом и при хорошей влажности, но зимой при включённых батареях их поведёт, ничего не поделаешь; 
5) Использованы 2 листа из дополнения "Эхо прошлого". Пометки сделаны карандашом, в коробке есть ещё по 1 чистому листу для персонажей (в дополнении по 2 листа на каждого персонажа базы и дополнений);
6) "Боевые руны" и "Вечная осень" не вскрыты, не играны.

Продаю ТОЛЬКО ПРИ ЛИЧНОЙ ВСТРЕЧЕ. В комментариях не отвечаю, пожалуйста, пишите сразу в личные сообщения. Бронь на сутки — бесплатно, на 2, 3 и так далее дня — по предоплате 10%. 

На обмен интересны следующие дополнения к первой редакции Descent Journeys in the Dark: 
1) Well of Darkness; 
2) Altar of Despair; 
3) Tomb of Ice; 
4) Sea of Blood (при наличии хотя бы 2 из дополнений выше); 
5) Quest Compendium (при наличии дополнений из пунктов 1-3, без них Quest Compendium не имеет смысла). 

Доплату в чью-либо сторону обсудим при обмене.

Дополнительные фото, вопросы — отвечаю в личных сообщениях.
